  }
  render(){
    return(
      <Pubu_warpper>
        <div className="floor">
          <h3 className="floor_hit">
            为你推荐
          </h3>
        </div>
      <div className="grid_c1">
        <ul className="more2_list">
          <li className="more2_item">
            <div className="img_text">
              <img className="img_pubu" src="https://img20.360buyimg.com/jdcms/s150x150_jfs/t5578/114/8074562411/547010/c5cc887f/59774d69N374823be.jpg.webp"/>
              <p className="txt_name">洁麦 淋浴房整体浴室沐浴房蒸汽桑拿保温 90*90镜面钢化玻璃+贴防爆膜 不含蒸汽</p>
            </div>
          </li>
        </ul>
      </div>
      </Pubu_warpper>
    )
  }
}

export default Pubu;
